  var mydata = [["", ""], ["", ""], ["", ""], ["", ""], ["", ""], ["", ""], ["2011 Census: population and household estimates for England and Wales - unrounded figures for the data published 16 July 2012", ""], ["Published 24 September 2012", ""], ["", ""], ["This product is part of the first release of unrounded results from the 2011 Census of Population for England and Wales. ", ""], ["", ""], ["The release provides information for England and Wales and constituent regions, counties, London boroughs, districts and unitary ", ""], ["authorities as at census day, 27 March 2011. The estimates included are the unrounded figures for those first released ", ""], ["in the 'Population and household estimates for England and Wales' on 16 July 2012, which were rounded to 100.", ""], ["", ""], ["These 2011 Census estimates also precede those of the 2011 mid-year (30 June) population estimates which have been rebased to take ", ""], ["account of the 2011 Census results rather than being rolled forward from the 2001 Census. Care should be taken when interpreting the", ""], ["census estimates and the mid-year estimates because they refer to different points in time and because they are based on slightly ", ""], ["different definitions and methodology. Further information about these differences will accompany  the release of the rebased mid-year ", ""], ["estimates also available from the Office for National Statistics website.", ""], ["", ""], ["In due course the mid-year population estimate series for 2002-2010 will also be rebased to reflect the results of the 2011 Census; ", ""], ["the rebased national level mid-year population estimate series will be published by the end of 2012 and sub-national estimates will be ", ""], ["released in spring 2013.", ""], ["", ""], ["This release is in accordance with section 20 of the Statistics and Registration Service Act 2007.", ""], ["", ""], ["The figures in this product include selected figures from the 2011 Census population and household estimates and additional or derived figures.", ""], ["1991 and 2001 population comparison figures are taken from the final mid-year population estimates, and 2001 household comparison ", ""], ["figures are those from the historical household projection figures (produced by the Department for Communities and Local Government) ", ""], ["and from 2010 Household Estimates for Wales (produced by the Welsh Government). 2001-2011 percentage changes are derived using", ""], [" these figures. Overall 2011 Census response rates and internet response rates are also included.", ""], ["", ""], ["The figures and derived measures are provided in a single table with information for each local and unitary authority, and also in an ", ""], ["interactive profile that summarises and presents information for a specific area selected, together with regional and national rankings ", ""], ["and those of the minimum and maximum district within the same region.", ""], ["", ""], ["Confidentiality", ""], ["ONS as the executive arm of the UK Statistics Authority has a legal obligation not to reveal information collected in confidence in the ", ""], ["census about individual people and households. The confidentiality of all census results, including the counts in this release, ", ""], ["is protected by a combination of a variety of disclosure protection measures.", ""], ["", ""], ["Contents", ""], ["Title", "2011 Census: Population and household estimates fact file, unrounded estimates, local authorities "], ["", "in England and Wales"], ["Geographic coverage", "England and Wales"], ["Geographic breakdown", "District, unitary authority"], ["", ""], ["Sources", ""], ["2011 Census estimates", ""], ["http://www.ons.gov.uk/ons/rel/census/2011-census/index.html", ""], ["", ""], ["Final 1991 and 2001 mid-year population estimates", ""], ["http://www.ons.gov.uk/ons/rel/pop-estimate/population-estimates-for-uk--england-and-wales--scotland-and-northern-ireland/index.html", ""], ["", ""], ["Historical household projections, Department for Communities and Local Government ", ""], ["http://www.communities.gov.uk/housing/housingresearch/housingstatistics/housingstatisticsby/householdestimates/livetables-households", ""], ["", ""], ["2010 Household Estimates for Wales, Welsh Government", ""], ["http://wales.gov.uk/topics/statistics/headlines/housing2011/111006/?lang=en", ""], ["", ""], ["Area measurements (land area measurements, 2001, 2010), ONS Geography", ""], ["ons.geography@ons.gov.uk", ""], ["", ""], ["2011 Census response rates", ""], ["http://www.ons.gov.uk/ons/guide-method/census/2011/census-data/2011-census-data/2011-first-release/local-authority-quality-assurance/2011-census-quality-assurance-pack-data-tables.xls", ""], ["", ""], ["", ""], ["2001 Census response rates", ""], ["http://www.ons.gov.uk/ons/guide-method/census/census-2001/data-and-products/quality-of-the-census-data/response-rates/index.html", ""], ["", ""], ["2011 Census internet return rates", ""], ["http://www.ons.gov.uk/ons/guide-method/census/2011/the-2011-census/the-2011-census-project/2011-census-updates-and-evaluation-reports/index.html", ""], ["", ""], ["", ""], ["Measures", ""], ["1991 final mid-year population estimate", ""], ["2001 final mid-year population estimate", ""], ["2011 Census population estimate (usual residents)", ""], ["Percentage change between 1991 and 2001 mid-year population estimates", ""], ["Percentage change between 2001 mid-year population estimates and 2011 census estimates", ""], ["2001 population density (population per area, km2)(derived from 2001 mid-year population estimates)", ""], ["2011 population density (population per area, km2)(derived from 2011 Census estimate)", ""], ["2001 sex ratio (Males/Females x 100) (derived from 2001 mid-year population estimate)", ""], ["2011 sex ratio (Males/Females x 100) (derived from 2011 Census population estimate)", ""], ["2001 median age (derived from 2001 mid-year population estimate, 5 year age bands)", ""], [ 00)", ""], ["", ""], ["Notes and Definitions", ""], ["1. The 2011 Census figures used are unrounded estimates. The mid-year estimates of the population for 1991 and 2001 are", ""], ["rounded to the nearest 100, and measures derived from these mid-year estimates are derived from rounded figures. ", ""], ["The household figures for England in 2001 are rounded to the nearest 1000, those for Wales are rounded to the nearest 100.", ""], ["2. The main population base for outputs from the 2011 Census is the usual resident population as at census day (27 March 2011). ", ""], ["Although the population base for enumeration included non-UK short-term residents, these are not included in the main outputs from the ", ""], ["2011 Census, but are analysed separately. All outputs, unless specified, are produced using only usual residents of the UK. ", ""], ["For 2011 Census purposes, a usual resident of the UK is anyone who, on census day, was in the UK and had stayed or intended to ", ""], ["stay in the UK for a period of 12 months or more, or had a permanent UK address and was outside the UK and intended to be outside ", ""], ["the UK for less than 12 months.", ""], ["3. For the 2011 Census a household is defined as one person living alone, or a group of people (not necessarily related) living at the same ", ""], ["address who share cooking facilities and share a living room, sitting room or dining area.", ""], ["4. A household resident is a person whose place of usual residence is a household, and not within managed residential accommodation in ", ""], ["a communal establishment.", ""], ["5. For the 2011 Census a non-UK short-term resident is anyone born outside the UK who has stayed or intends to stay in the UK for a period ", ""], ["of three months or more but less than 12 months. For more information see ", ""], ["http://www.ons.gov.uk/census", ""], ["6. 2001 median age, derived from 2001 mid-year population estimates, is calculated using figures for five year age bands and assumes that ", ""], ["within each band the ages follow the national single year of age distribution.", ""], ["7. Area codes used are those operative from 1 January 2011. ", ""], ["8. Area measurements used to derive population densities are land measurement figures defined by topographic boundaries", ""], ["(coastline and inland water) as at the end of 2010 (for 2011 population densities) and the end of 2001 (for 2001 population densities).", ""], ["9. The 2011 population densities are calculated using exact areas measurements for each district and unitary authority. These figures", ""], ["may vary slightly compared to some similar population densities published subsequent to September 2012 that use a best fit of Output Area", ""], ["area measurements to calculate population density.", ""], ["10. Further information about the census estimates, including details about the methodology and information about how other population ", ""], ["sub-groups are counted, and other definitions, are available on the ONS website at", ""], ["http://www.ons.gov.uk/census", ""], ["11. Information about the differences in the unrounded figures in this release and the rounded figures published 16 July are available", ""], ["in the Report and Frequently Asked Questions (FAQs) that accompanying this release.", ""], ["12. Further information about the mid-year population estimates, including releases of the latest estimates, commentary and details about ", ""], ["the methodology used can be found on the ONS website at", ""], ["http://www.ons.gov.uk/ons/rel/pop-estimate/population-estimates-for-england-and-wales/index.html", ""], ["13. Caution must be taken in the interpretation of change between the 2011 Census estimates and the historical comparison figures used ", ""], ["because of differences in the reference period, methodology and definitions used in each source of the estimates included.", ""], ["", ""], ["", ""], ["Terms and conditions", ""], ["1. All material on the Office for Nati
